import React, { useEffect, useState } from "react";

// We'll use ethers to interact with the Ethereum network and our contract
import { ethers } from "ethers";

// We import the contract's artifacts and address here, as we are going to be
// using them with ethers
import TokenArtifact from "../contracts/Token.json";
import contractAddress from "../contracts/contract-address.json";

// All the logic of this dapp is contained in the Dapp component.
// These other components are just presentational ones: they don't have any
// logic. They just render HTML.
import { NoWalletDetected } from "./NoWalletDetected";
import { ConnectWallet } from "./ConnectWallet";
import { Loading } from "./Loading";
import { Transfer } from "./Transfer";
import { TransactionErrorMessage } from "./TransactionErrorMessage";
import { WaitingForTransactionMessage } from "./WaitingForTransactionMessage";
import { NoTokensMessage } from "./NoTokensMessage";
import { Tickets } from './new_components/tickets';

// This is the Hardhat Network id, you might change it in the hardhat.config.js
// Here's a list of network ids https://docs.metamask.io/guide/ethereum-provider.html#properties
// to use when deploying to other networks.
const HARDHAT_NETWORK_ID = '31337';

// This is an error code that indicates that the user canceled a transaction
const ERROR_CODE_TX_REJECTED_BY_USER = 4001;

// This component is in charge of doing these things:
//   1. It connects to the user's wallet
//   2. Initializes ethers and the Token contract
//   3. Polls the user balance to keep it updated.
//   4. Transfers tokens by sending transactions
//   5. Renders the whole application
//
// Note that (3) and (4) are specific of this sample application, but they show
// you how to keep your Dapp and contract's state in sync,  and how to send a
// transaction.

const BDapp = () => {

    // The info of the token (i.e. It's Name and symbol)
    const [tokenData, setTokenData] = useState(undefined);

    // The user's address and balance
    const [selectedAddress, setSelectedAddress] = useState(undefined);
    const [balance, setBalance] = useState(undefined);

    // The ID about transactions being sent, and any possible error with them
    const [txBeingSent, setTxBeingSent] = useState(undefined);
    const [transactionError, setTransactionError] = useState(undefined);
    const [networkError, setNetworkError] = useState(undefined);

    const [tokenE, setTokenE] = useState(undefined);
    const [pollDataInterval, setPDI] = useState(undefined);

    // fake data recieved from db - init: undefined
    const [userTickets, setUserTickets] = useState([{title: 'Thrilling Event starring Ben', desc: "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.", hex: ''},
        {title: 'Stadia Ipsum featuring John', desc: "It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMakerincluding versions of Lorem Ipsum.", hex: ''}]);

    useEffect(() => {

        if (tokenE !== undefined) {

            getTokenData();
            startPollingData();

        }

    }, [tokenE])

    const connectWallet = async () => {
        // This method is run when the user clicks the Connect. It connects the
        // dapp to the user's wallet, and initializes it.
    
        // To connect to the user's wallet, we have to run this method.
        // It returns a promise that will resolve to the user's address.
        const [selectedAddress] = await window.ethereum.enable();
    
        // Once we have the address, we can initialize the application.
    
        // First we check the network
        if (!checkNetwork()) {
          return;
        }
    
        initialize(selectedAddress);
    
        // We reinitialize it whenever the user changes their account.
        window.ethereum.on("accountsChanged", ([newAddress]) => {
          stopPollingData();
          // `accountsChanged` event can be triggered with an undefined newAddress.
          // This happens when the user removes the Dapp from the "Connected
          // list of sites allowed access to your addresses" (Metamask > Settings > Connections)
          // To avoid errors, we reset the dapp state 
          if (newAddress === undefined) {
            return resetState();
          }
          
          initialize(newAddress);
        });
        
        // We reset the dapp state if the network is changed
        window.ethereum.on("networkChanged", ([networkId]) => {
          stopPollingData();
          resetState();
        });
    }

    const initialize = (userAddress) => {
        // This method initializes the dapp
    
        // We first store the user's address in the component's state
        setSelectedAddress(userAddress);
    
        // Then, we initialize ethers, fetch the token's data, and start polling
        // for the user's balance.
    
        // Fetching the token data and the user's balance are specific to this
        // sample project, but you can reuse the same initialization pattern.
        intializeEthers();
    }

    const intializeEthers = async () => {
        // We first initialize ethers by creating a provider using window.ethereum
        const provider = new ethers.providers.Web3Provider(window.ethereum);
    
        // When, we initialize the contract using that provider and the token's
        // artifact. You can do this same thing with your contracts.
        setTokenE(new ethers.Contract(
          contractAddress.Token,
          TokenArtifact.abi,
          provider.getSigner(0)
        ));

    }
    
    
    // The next two methods are needed to start and stop polling data. While
    // the data being polled here is specific to this example, you can use this
    // pattern to read any data from your contracts.
    //
    // Note that if you don't need it to update in near real time, you probably
    // don't need to poll it. If that's the case, you can just fetch it when you
    // initialize the app, as we do with the token data.
    const startPollingData = () => {
        setPDI(setInterval(() => updateBalance(), 1000));

        // We run it once immediately so we don't have to wait for it
        updateBalance();
    }

    const stopPollingData = () => {
        clearInterval(pollDataInterval);
        setPDI(undefined);
    }

    // The next two methods just read from the contract and store the results
    // in the component state.
    const getTokenData = async () => {

        const name = await tokenE.name();
        const symbol = await tokenE.symbol();

        setTokenData({ name, symbol });
    }

    const updateBalance = async () => {
        const balance = await tokenE.balanceOf(selectedAddress);
        setBalance(balance);
    }

    // This method sends an ethereum transaction to transfer tokens.
    // While this action is specific to this application, it illustrates how to
    // send a transaction.
    const transferTokens = async (to, amount) => {
        // Sending a transaction is a complex operation:
        //   - The user can reject it
        //   - It can fail before reaching the ethereum network (i.e. if the user
        //     doesn't have ETH for paying for the tx's gas)
        //   - It has to be mined, so it isn't immediately confirmed.
        //     Note that some testing networks, like Hardhat Network, do mine
        //     transactions immediately, but your dapp should be prepared for
        //     other networks.
        //   - It can fail once mined.
        //
        // This method handles all of those things, so keep reading to learn how to
        // do it.

        try {
        // If a transaction fails, we save that error in the component's state.
        // We only save one such error, so before sending a second transaction, we
        // clear it.
        dismissTransactionError();

        // We send the transaction, and save its hash in the Dapp's state. This
        // way we can indicate that we are waiting for it to be mined.
        const tx = await tokenE.transfer(to, amount);
        setTxBeingSent(tx.hash);

        // We use .wait() to wait for the transaction to be mined. This method
        // returns the transaction's receipt.
        const receipt = await tx.wait();

        // The receipt, contains a status flag, which is 0 to indicate an error.
        if (receipt.status === 0) {
            // We can't know the exact error that made the transaction fail when it
            // was mined, so we throw this generic one.
            throw new Error("Transaction failed");
        }

        // If we got here, the transaction was successful, so you may want to
        // update your state. Here, we update the user's balance.
        await updateBalance();
        } catch (error) {
        // We check the error code to see if this error was produced because the
        // user rejected a tx. If that's the case, we do nothing.
        if (error.code === ERROR_CODE_TX_REJECTED_BY_USER) {
            return;
        }

        // Other errors are logged and stored in the Dapp's state. This is used to
        // show them to the user, and for debugging.
        console.error(error);
        setTransactionError(error);
        } finally {
        // If we leave the try/catch, we aren't sending a tx anymore, so we clear
        // this part of the state.
        setTxBeingSent(undefined);
        }
    }

    // This method just clears part of the state.
    const dismissTransactionError = () => {
        setTransactionError(undefined)
    }

    // This method just clears part of the state.
    const dismissNetworkError = () => {
        setNetworkError(undefined);
    }

    // This is an utility method that turns an RPC error into a human readable
    // message.
    const getRpcErrorMessage = (error) => {
        if (error.data) {
        return error.data.message;
        }

        return error.message;
    }

    // This method resets the state
    const resetState = () => {
        setTokenData(undefined);
        setSelectedAddress(undefined);
        setBalance(undefined);
        setTxBeingSent(undefined);
        setTransactionError(undefined);
        setNetworkError(undefined);
    }

    // This method checks if Metamask selected network is Localhost:8545 
    const checkNetwork = () => {
        if (window.ethereum.networkVersion === HARDHAT_NETWORK_ID) {
        return true;
        }

        setNetworkError('Please connect Metamask to Localhost:8545')

        return false;
    }

    // Ethereum wallets inject the window.ethereum object. If it hasn't been
    // injected, we instruct the user to install MetaMask.
    if (window.ethereum === undefined) {

        return <NoWalletDetected />;

    }

    // The next thing we need to do, is to ask the user to connect their wallet.
    // When the wallet gets connected, we are going to save the users's address
    // in the component's state. So, if it hasn't been saved yet, we have
    // to show the ConnectWallet component.
    //
    // Note that we pass it a callback that is going to be called when the user
    // clicks a button. This callback just calls the _connectWallet method.
    if (!selectedAddress) {

        return (
            <ConnectWallet 
                connectWallet={() => connectWallet()} 
                networkError={networkError}
                dismiss={() => dismissNetworkError()}
            />
        );

    }

    // If the token data or the user's balance hasn't loaded yet, we show
    // a loading component.
    if (!tokenData || !balance) {

        return <Loading />;

    }

    // If everything is loaded, we render the application.
    if (true) {
        return(

            <div className="ticket-page">

                <div className="nav">

                    <div className="unselect"><div><span style={{fontWeight: 450}}>ticket.</span>decentral<span style={{fontWeight: 450}}>*</span></div><div className="sub unselect"><span style={{fontWeight: 450}}>*</span>own your events</div></div>
                    <div></div>

                </div>

                <div className="main">

                    <div className="hype">new events (based on hype, search bar inc.)</div>
                    <div><Tickets tickets={userTickets} /></div>
                    <div></div>

                </div>

            </div>

        )
    } else {
    return (

        <div className="container p-4">
            <div className="row">
            <div className="col-12">
                <h1>
                {tokenData.name} ({tokenData.symbol})
                </h1>
                <p>
                Welcome <b>{selectedAddress}</b>, you have{" "}
                <b>
                    {balance.toString()} {tokenData.symbol}
                </b>
                .
                </p>
            </div>
            </div>
    
            <hr />
    
            <div className="row">
            <div className="col-12">
                {/* 
                Sending a transaction isn't an immidiate action. You have to wait
                for it to be mined.
                If we are waiting for one, we show a message here.
                */}
                {txBeingSent && (
                <WaitingForTransactionMessage txHash={txBeingSent} />
                )}
    
                {/* 
                Sending a transaction can fail in multiple ways. 
                If that happened, we show a message here.
                */}
                {transactionError && (
                <TransactionErrorMessage
                    message={getRpcErrorMessage(transactionError)}
                    dismiss={() => dismissTransactionError()}
                />
                )}
            </div>
            </div>
    
            <div className="row">
            <div className="col-12">
                {/*
                If the user has no tokens, we don't show the Tranfer form
                */}
                {balance.eq(0) && (
                <NoTokensMessage selectedAddress={selectedAddress} />
                )}
    
                {/*
                This component displays a form that the user can use to send a 
                transaction and transfer some tokens.
                The component doesn't have logic, it just calls the transferTokens
                callback.
                */}
                {balance.gt(0) && (
                <Transfer
                    transferTokens={(to, amount) =>
                    transferTokens(to, amount)
                    }
                    tokenSymbol={tokenData.symbol}
                />
                )}
            </div>
            </div>
        </div>

    );
    }

}

export { BDapp };